import React from "react";
import "./App.css";

export const Project = ({ name, count }) =>
  fetch("https://github-dependents.glitch.me/" + { name } + "/react?limit=1")
    .then(response => response.json())
    .then(data => {
      let count = data.totalDependants;
      return (document.getElementById("count").innerHTML = count);
    });

function App() {
  return (
    <div className="App">
      <Project name="facebook" />
      <header className="App-header">
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Used by
        </a>
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
      </header>
    </div>
  );
}

export default App;
